import React from 'react';

export const ForgotPasswordPageConfig = {
    settings: {
        layout: {
            config: {}
        }
    },
    routes  : [
        {
            path     : '/forgot-password',
            component: React.lazy(() => import('./ForgotPasswordPage'))
        }
    ]
};
